import React, {useState} from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';
import ButtonGroup from "@material-ui/core/ButtonGroup";
import Button from "@material-ui/core/Button";

const useStyles = makeStyles((theme) => ({
    root: {
        flexGrow: 1,
    },
    paper: {
        padding: theme.spacing(2),
        textAlign: 'center',
        color: theme.palette.text.secondary,
    },
    buttonGroup: {
        margin: '0 1em 0 1em',
    }
}));

const Navbar = () => {
    const classes = useStyles();

    return (
        <div className={classes.root}>
            <Grid container>
                <Grid item xs={12}>
                    <Paper className={classes.paper} elevation={0}>
                        <ButtonGroup variant="text" color="primary" aria-label="text primary button group">
                            <Button className={classes.buttonGroup}>Home</Button>
                            <Button className={classes.buttonGroup}>Juices</Button>
                            <Button className={classes.buttonGroup}>Create</Button>
                            <Button className={classes.buttonGroup}>Favorites</Button>
                        </ButtonGroup>
                    </Paper>
                </Grid>
            </Grid>
        </div>
    )
}
export default Navbar
